using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;
using System.Collections.Generic;
using TacticsWarMud.TypeDefinitions;

namespace TacticsWarMud.SystemDefinition
{
    public partial class CombatSystemDeployment : CombatSystemDeploymentBase
    {
        public CombatSystemDeployment() : base(BYTECODE) { }
        public CombatSystemDeployment(string byteCode) : base(byteCode) { }
    }

    public class CombatSystemDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public CombatSystemDeploymentBase() : base(BYTECODE) { }
        public CombatSystemDeploymentBase(string byteCode) : base(byteCode) { }

    }

    public partial class AttackFunction : AttackFunctionBase { }

    [Function("tacticsWar__attack")]
    public class AttackFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_matchEntity", 1)]
        public virtual byte[] MatchEntity { get; set; }
        [Parameter("bytes32", "_entity", 2)]
        public virtual byte[] Entity { get; set; }
        [Parameter("bytes32", "_target", 3)]
        public virtual byte[] Target { get; set; }
    }

    public partial class MoveOrAttackFunction : MoveOrAttackFunctionBase { }

    [Function("tacticsWar__moveOrAttack")]
    public class MoveOrAttackFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "_matchEntity", 1)]
        public virtual byte[] MatchEntity { get; set; }
        [Parameter("bytes32", "_entity", 2)]
        public virtual byte[] Entity { get; set; }
        [Parameter("tuple[]", "path", 3)]
        public virtual List<PositionData> Path { get; set; }
    }
}